import React from 'react'

const Video = () => {
    return (
        <div className='pt-4 mt-4 text-center'>
            <iframe width="100%" height="400" src="https://www.youtube.com/embed/5F_JUvPq410" frameBorder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowFullScreen></iframe>
        </div>
    )
}

export default Video
